import React, { Component } from 'react'
 
import Card from 'react-animated-3d-card'
 
const Cards = () => {
 
    return <>


    <div className="cards_college">
    <Card       
      style={{
        backgroundColor: 'red',
        width: '450px',
        height: '300px',
        cursor: 'pointer'
      }}
      onClick={() => console.log('Card clicked')}
    />
    </div>

    <div className="cards_college">
    <Card       
      style={{
        backgroundColor: 'red',
        width: '450px',
        height: '300px',
        cursor: 'pointer'
      }}
      onClick={() => console.log('Card clicked')}
    />
    </div>

    <div className="cards_college">
    <Card       
      style={{
        backgroundColor: 'red',
        width: '450px',
        height: '300px',
        cursor: 'pointer'
      }}
      onClick={() => console.log('Card clicked')}
    />
    </div>
    

    </>
  }


export default Cards
